import React from 'react';
import AppRouter from './AppRouter';
import { UserContext } from './UserContext';

const MainApp = () => {

    const user = {
        id: 1234,
        name: 'Fernando',
        email: 'flopezramirez@hotmail.com'
    };

	return (
        <UserContext.Provider value={ user }>
            <AppRouter />
        </UserContext.Provider>
	);
}

export default MainApp;
